import React, { useState } from "react";
import './cart.css'
import{ICourse} from'../Interface/ICourse'

const Cart = (props: { data:ICourse[]}) => {
  const [price,setprice]=useState();
  return(

    <div className="cart"> {props.data.map((value,key)=>{
       return (
        <div>
          <label className="image">{value.image}</label>
          <label className="title">{value.Tittle}</label>
          <label className="price">{value.ActualPrice}</label>  
        </div>
      );

      })} </div>
  );
}

export default Cart;
